import React, { Component } from "react";
import "./style.css";
class LoginForm extends Component {
  render() {
    const formStyle = {
      margin: "auto",
      maxWidth: "200px",
      padding: "15px"
    };
    const formGroupStyle = {};
    const inputStyle = {};
    const buttonStyle = {};

    return (
      <form style={formStyle}>
        <formgroup style={formGroupStyle}>
          <input style={inputStyle} type="text"></input>
        </formgroup>
      </form>
    );
  }
}

export default LoginForm;
